import { DECREASE_NUMBER, INCREASE_NUMBER } from "../constants/numberConstants";

export let increaseNumberAction = () => {
  return {
    type: INCREASE_NUMBER,
  };
};
export let decreaseNumberAction = (value) => {
  return {
    type: DECREASE_NUMBER,
    payload: value,
  };
};
